import React, { useEffect, useRef, useState } from 'react';

const CameraComponent: React.FC = () => {
  const videoRef = useRef<HTMLVideoElement | null>(null);
  const canvasRef = useRef<HTMLCanvasElement | null>(null);
  const [imageDataUrl, setImageDataUrl] = useState<string | null>(null);

  useEffect(() => {
    const startCamera = async () => {
      try {
        const stream = await navigator.mediaDevices.getUserMedia({
          video: { facingMode: 'environment' },
          audio: false,
        });
        if (videoRef.current) {
          videoRef.current.srcObject = stream;
        }
      } catch (err) {
        console.error('„Ç´„É°„É©„ÅÆËµ∑Âãï„Å´Â§±Êïó„Åó„Åæ„Åó„Åü:', err);
      }
    };

    startCamera();
  }, []);

  const handleCapture = () => {
    const video = videoRef.current;
    const canvas = canvasRef.current;
    if (!video || !canvas) return;

    const context = canvas.getContext('2d');
    if (!context) return;

    canvas.width = video.videoWidth;
    canvas.height = video.videoHeight;
    context.drawImage(video, 0, 0, canvas.width, canvas.height);

    const dataUrl = canvas.toDataURL('image/png');
    setImageDataUrl(dataUrl);
  };

  const handleUpload = async () => {
    if (!imageDataUrl) return;

    const blob = await (await fetch(imageDataUrl)).blob();
    const formData = new FormData();
    formData.append('image', blob, 'photo.png');

    try {
      const res = await fetch('http://localhost:5000/upload', {
        method: 'POST',
        body: formData,
      });

      if (!res.ok) throw new Error('„Ç¢„ÉÉ„Éó„É≠„Éº„ÉâÂ§±Êïó');
      alert('‚úÖ ÁîªÂÉè„Çí„Ç¢„ÉÉ„Éó„É≠„Éº„Éâ„Åó„Åæ„Åó„Åü');
    } catch (err) {
      console.error(err);
      alert('‚ùå ÁîªÂÉè„ÅÆÈÄÅ‰ø°„Å´Â§±Êïó„Åó„Åæ„Åó„Åü');
    }
  };

  return (
    <div>
      <video ref={videoRef} width="640" height="480" autoPlay playsInline />
      <br />
      <button onClick={handleCapture}>üì∏ „Ç∑„É£„ÉÉ„Çø„Éº</button>
      <canvas ref={canvasRef} style={{ display: 'none' }} />
      <br />
      {imageDataUrl && (
        <div>
          <img src={imageDataUrl} alt="ÊíÆÂΩ±ÁîªÂÉè" width="640" />
          <br />
          <button onClick={handleUpload}>‚òÅÔ∏è „Éê„ÉÉ„ÇØ„Ç®„É≥„Éâ„Å´ÈÄÅ‰ø°</button>
        </div>
      )}
    </div>
  );
};

export default CameraComponent;
